import axios from 'axios';
import React, {Component} from 'react';
import {Line} from 'react-chartjs-2';
import CovidTrackerService from '../services/CovidTrackerService';

class CovidTrackerComponent extends Component {

    constructor(props) {
        super(props);
        this.state = {
            country: []
        }
    }

    componentDidMount() {
        CovidTrackerService.getData().then(resp=>{
            this.setState({country: resp.data});
        })
    }

    render() {
        const d = {
            //labels: labels,
            datasets: [{
              label: 'My First Dataset',
              data: [65, 59, 80, 81, 56, 55, 40],
              fill: false,
              borderColor: 'rgb(75, 192, 192)',
              tension: 0.1
            }]
          };
        return (
            <Line data = {d}/>
        )
    }
}

export default CovidTrackerComponent;
